from telebot import typesfrom dataclasses import dataclassfrom button import Button@dataclassclass Admin:    flag: int = 0    username: int = 0    message_id: int = 0    button: Button = Button()class nsql_database:    def __init__(self) -> None:        self.data = {}    # Получение значения по ключу    def get_elem(self, key: int | str) -> Admin | bool:        if key in self.data:            return self.data[key]        else:            return Falseclass Admins(nsql_database):    def __init__(self):        super().__init__()        self.keyboard = types.InlineKeyboardMarkup(row_width=1)    def __add_user(self, id):        self.data[id] = Admin()        return self    def __add__(self, id: int):        return self.__add_user(id)    def __iadd__(self, id: int):        return self.__add_user(id)    def __contains__(self, other) -> bool:        if other in self.data:            return True        else:            return False